import React from "react";
import "../css/Featured.css";
import Product from "./Product";
function Featured() {
  return (
    <div className="featured-container section-padding">
      <div className="featured-title">
        <h2>Featured Products</h2>
      </div>
      <div className="product-categories">
        <button className="type ">Vitamins</button>
        <button className="type">Face Care</button>
        <button className="type">Body Care</button>
        <button className="type">Medical Equiment</button>
        <button className="type">Health</button>
        <button className="type">Personal Care</button>
        <button className="type">Muscle Care</button>
      </div>
      <Product />
    </div>
  );
}

export default Featured;
